class Request {
	private Api: any;

	constructor(baseUrl: string) {
		this.Api = axios.create({baseURL: `http://gopiko.fr:9090/`});	
  	}

	Post(endpoint: string, data: any) {
		 const headers = {
       			 'Content-Type': 'text/plain'
   		 };
		return this.Api.post(endpoint, 'dat', headers);
	}
}

export default Request
